webpackJsonp([23665830163266],{8302:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Karneval in Nindorf",date:"27 Feb 2006",slug:"/2006-02-27-karneval-in-nindorf/",tags:"Y2006"},html:'<p>Everyone is <a href="http://www.olbertz.de/archives/000695.html">publishing</a> <a href="http://expat-odyssey.blogspot.com/2006/02/confessions-of-faschingsmuffel.html">Karneval</a> <a href="http://justcallmemausi.blogspot.com/2006/02/hannover-helau.html">pictures</a> <a href="http://lumma.de/eintrag.php?id=2549">today</a>! Here\'s Kamelle (candy) being tossed to the crowd of eager kids.</p>\n<p><a href="http://www.flickr.com/photos/papascott/105342798/" title="Photo Sharing"><img src="http://static.flickr.com/34/105342798_1cd2d6019b_m.jpg" width="240" height="180" alt="IMG_1318" /></a></p>\n<p>The parade participants are lining up.</p>\n<p><a href="http://www.flickr.com/photos/papascott/105349145/" title="Photo Sharing"><img src="http://static.flickr.com/34/105349145_9c8f38b6c1_m.jpg" width="240" height="180" alt="IMG_1328" /></a></p>\n<p>More pictures of <a href="http://flickr.com/photos/papascott/tags/nindorfkarneval/show/">Karneval in Nindorf</a>!</p>\n<p>(In case you missed the irony tag, these aren\'t really Karneval pictures. Karneval isn\'t celebrated in northern Germany. These are from our visit to the WildPark in Nindorf yesterday.)</p>'},next:{fields:{title:"All Jabber transports suck",date:"27 Feb 2006",slug:"/2006-02-27-all-jabber-transports-suck/"}},previous:{fields:{title:"Myth and Reality",date:"28 Feb 2006",slug:"/2006-02-28-myth-and-reality/"}}},{node:{fields:{title:"All Jabber transports suck",date:"27 Feb 2006",slug:"/2006-02-27-all-jabber-transports-suck/",tags:"Y2006"},html:'<p><a href="http://www.usrportage.de/archives/538-About-ejabberd,-transports,-lazy-Gentoo-developers-and-the-gloriousness-of-Schokokeks.org.html" title="About ejabberd, transports, lazy Gentoo-developers and the gloriousness of Schokokeks.org - /usr/portage">All Jabber transports suck</a>,  and all Linux distributions as well. Thereore, sys admins will always be in demand.</p>'},next:{fields:{title:"One of the odd things about working remotely",date:"24 Feb 2006",slug:"/2006-02-24-one-of-the-odd-things-about-working-remotely/"}},previous:{fields:{title:"Karneval in Nindorf",date:"27 Feb 2006",slug:"/2006-02-27-karneval-in-nindorf/"}}},{node:{fields:{title:"One of the odd things about working remotely",date:"24 Feb 2006",slug:"/2006-02-24-one-of-the-odd-things-about-working-remotely/",tags:"Y2006"},html:'<p><a href="http://inessential.com/?comments=1&postid=3257" title="inessential.com: Weblog: Comments for &lsquo;New digs&rsquo;">One of the odd things about working remotely</a> is that when your <a href="http://mabber.com">company\'s hot new product</a> gets a <a href="http://www.techcrunch.com/2006/02/23/mabber-mobile-instant-messaging/">good review</a>, you find about it <a href="http://laughingmeme.org/articles/2006/02/23/papascott-s-project-mabber">in another blog</a> via a <a href="http://www.technorati.com/search/www.papascott.de">Technorati search</a>. </p>'},next:{fields:{title:"Dear Elena",date:"23 Feb 2006",slug:"/2006-02-23-dear-elena/"}},previous:{fields:{title:"All Jabber transports suck",date:"27 Feb 2006",slug:"/2006-02-27-all-jabber-transports-suck/"}}}],pathPrefix:"",first:!1,last:!1,index:236,pageCount:1101}}}});
